import React, { FC } from "react";
import Todo from "../models/todo";

type TodosProps = {
  items: Todo[];
};

const Todos: FC<TodosProps> = (props) => {
  return (
    <ul>
      {props.items.map((item) => (
        <li>{item.text}</li>
      ))}
    </ul>
  );
};

export default Todos;
